            std::vector<double>
            coordination_numbers(const arma::mat& coords,
                                 const std::vector<unsigned>& z,
                                 const double k)
            {
                const std::size_t no_atoms = coords.n_rows;
                std::vector<double> cn(no_atoms, 0);

                for (std::size_t a = 0; a < no_atoms; ++a) {
                    for (std::size_t b = 0; b < no_atoms; ++b) {
                        if (a == b)
                            continue;

                        const double dx = coords(b, 0) - coords(a, 0);
                        const double dy = coords(b, 1) - coords(a, 1);
                        const double dz = coords(b, 2) - coords(a, 2);

                        const double r = std::sqrt(dx * dx + dy * dy + dz * dz);
                        const double rr = (rcov[z[a] - 1] + rcov[z[b] - 1]) / r;
                        const double damp =
                            1.0 / (1.0 + std::exp(-k * (rr - 1)));
                        cn[a] += damp;
                    }
                }

                return cn;
            }

